【キャンメイク リップティントシロップ 04 ポピーシロップの詳細】<br>
●飲んでも食べても発色キープ！ベタつかず、落ちにくいナチュラル血色リップ。<br>
●SPF15・PA+。美容保湿成分配合。<br>
●つけた後に唇に染みこむような色づきで発色し、キレイ色長持ち！<br>
●飲んでも食べても色落ちしにくいからこまめな塗りなおし不要のシロップリップ！<br><br>

【使用方法】<br>
グラデーションリップの作り方<br>
1.コンシーラーで唇の色味を消しておこう。<br>
2.唇の内側にリップティントシロップを塗ります。<br>
3.全体になじませるように上下の唇をすりあわせます。<br>
4.時間とともに発色UP！内側からじんわり発色したような唇に！<br><br>

【成分】<br>
リンゴ酸ジイソステアリル、ミネラルオイル、水添ポリイソブテン、オクチルドデカノール、メトキシケイヒ酸エチルヘキシル、ジフェニルシロキシフェニルトリメチコン、ジメチルシリル化シリカ、パルミチン酸デキストリン、フェノキシエタノール、トリイソステアリン酸ポリグリセリル-2、テトラヘキシルデカン酸アスコルビル、ポリヒドロキシステアリン酸、ラウロイルグルタミン酸ジ(フィトステリル／オクチルドデシル)、トコフェロール、シメチコン、(+／-)酸化チタン、酸化鉄、黄4、赤223、赤201、赤218、赤202、硫酸Ba、アルミナ<br><br>

【内容量】<br>
1本<br><br>

【販売元】<br>
井田ラボラトリーズ<br>
東京都新宿区市谷本村町1-1 住友市ヶ谷ビル3F<br>
お電話：03-3260-0671<br><br>

【商品区分】<br>
化粧品<br><br>

[CANMAKE リップティントシロップ] 

<br><br><br><hr>
広告文責：株式会社モリキ<br>
電話：0269-38-0611<br><style type="text/css">
